import './sign.css';
import Nav from '../Nav bar/Nav';
import Footer from '../footer section/footer';
import img1 from "./images/im1.png"
import img2 from "./images/im2.png"

function Sign() {
    let firstinput = document.getElementById("firstinput")
    if (firstinput.value == "") {
        firstinput.style.cssText="background:red;"
    }

  return (
    <div className="sign">
        <div className="contt">
            <form action="">
                <h1>Sign Up</h1>
                <hr />
                <div className="inputss">
                    <input type="text" id='firstinput'  placeholder='First Name' required/>
                    <input type="text"  placeholder='Last Name' required/>
                    <input type="text"  placeholder='Email address' required/>
                    <input type="text"  placeholder='Phone Number' required/>
                    <input type="text"  placeholder='Country' required/>
                    <input type="text"  placeholder='Password' required/>
                    <input type="text"  placeholder='Confirm Password' required/>
                </div>
                <button>SIGN UP</button>
                <h2>I have an account already ! <a href="">Login</a></h2>
            </form>
        </div>
        <div className="immmg2">
            <img src={img1} alt="" />
            <img src={img2} alt="" />
        </div>


    <Footer/>
    </div>
  );
}

export default Sign;
